  return (
    <section id="about">
      <div className="container">
        <div className="about__wrapper">
          <div className="about__content">
            <h6 className="subtitle">Why choose us</h6>
            <h2>Specialist in aviding clients on</h2>
            <h2 className="highlight"> financial challenges</h2>
            <p className="description about__content-desc">Lorem ipsum dolor sit amet consectetur adipisicing elit. Architecto ratione, ullam animi explicabo saepe cumque, suscipit quos necessitatibus possimus recusandae molestias ipsa cupiditate quisquam eum quod temporibus perferendis. Dolorum, accusamus!</p>

            <div className="choose__us-item">
                <span className="choose__us-icon"><i class="ri-wifi-line"></i></span>
                <div>
                    <h4 className="choose__us-title">First Working process</h4>
                    <p className="description">Lorem ipsum dolor sit amet consectetur adipisicing elit. Quia sint assumenda reiciendis sit maiores facilis laudantium et non fugit debitis?</p>
                </div>
            </div>
          </div>
          <div className="about__img"></div>
        </div>
      </div>
    </section>
  );
};

export default About;
